import React, { useState } from 'react';
import './Login.scss';
import SignUp from './SignUp'
import SignIn from './SignIn'
import { makeStyles } from '@material-ui/core/styles';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormControl from '@material-ui/core/FormControl';
import TextField from '@material-ui/core/TextField';
import Grid from '@material-ui/core/Grid';
import AccountCircle from '@material-ui/icons/AccountCircle';


const Login = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [show, setShow] = useState(<SignIn />);
  const myRef = React.createRef();


  const openModal = () => {
    setIsOpen(true);
    myRef.current.style.display = "block";
  }
  const closeModal = () => {
    setIsOpen(false);
    myRef.current.style.display = "none";
  }
  const signInShow = (e) => {
    setShow(<SignIn/>);
    e.stopPropagation();
  } 
   const signUpShow = (e) => {
     setShow(<SignUp/>);
    e.stopPropagation();
  }

  const useStyles = makeStyles((theme) => ({
    margin: {
      margin: theme.spacing(1),
    },
  }));
  
  return (<>
    {/* // <center> */}
       <FormControl className={classes.margin}>
        <InputLabel htmlFor="input-with-icon-adornment">With a start adornment</InputLabel>
        <Input
          id="input-with-icon-adornment"
          startAdornment={
            <InputAdornment position="start">
              <AccountCircle />
            </InputAdornment>
          }
        />
      </FormControl>
      <TextField
        className={classes.margin}
        id="input-with-icon-textfield"
        label="TextField"
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
              <AccountCircle />
            </InputAdornment>
          ),
        }}
      />
      <div className={classes.margin}>
        <Grid container spacing={1} alignItems="flex-end">
          <Grid item>

          </Grid>
          <Grid item>
            <TextField id="input-with-icon-grid" label="With a grid" >
              <AccountCircle />
            </TextField>
          </Grid>
        </Grid>
      </div>
    {/* </div>
      // <button onClick={openModal}  >Open Modal</button>
      // <div id="myModal" className="modal" onClick={closeModal} ref={myRef} >
      //   <div className="modal-content" >
      //     <div className="btn" id="btn_signin" onClick={signInShow} >SIGN IN</div>
      //     <div className="btn" id="btn_signup" onClick={ signUpShow}>SIGN UP</div>
      //     <div id="login_top">
      //       {show}
      //     </div>
      //     <div id="login_bottom"></div>
      //   </div>
      // </div>
    // </center> */}
    </>
  );
}

export default Login;
